Plot



Mission: Impossible 1996

Based on the hit T.V. series. Jim Phelps was sent to Prague for a mission to prevent the theft of classified material. His wife Claire and his trusted partner Ethan Hunt were members of Phelps' team. Unfortunately, something went horribly wrong and the mission failed, leaving Ethan Hunt the lone survivor. After he reported the failed mission, Kettridge the head if the agency suspects Ethan of being the culprit for the failed mission. Now, Ethan uses unorthodox methods (Which includes the aid of an arms dealer going by the name &quot;Max&quot; to try to find who set him up and to clear his name.

Mission: Impossible II 2000

IMF agent Ethan Hunt has been sent on a mission to retrieve and destroy the supply of a genetically created disease called 'Chimera'. His mission is made impossible due to the fact that he is not the only person after samples of the disease. He must also contest with a gang of international terrorists headed by a turned bad former IMF agent who has already managed to steal the cure called 'Bellerophon' and now need 'Chimera' to complete their grand plan of infecting the whole world. In order to infiltrate and locate the terrorist group he relies on the help of an international thief Nyah of whom he quickly develops a love interest. Time is not only running out for Agent Hunt to find and destroy 'Chimera' before the terrorists get their hands on it, but he must also find 'Bellerophon' so as to save his love interest who has already become infected by the disease from a terrible and rapid death.

Mission: Impossible III 2006

IMF agent Ethan Hunt has given up field work to train agents instead, because he is seeing someone, Julia whom he wants to marry and live a normal life with. But his friend, Billy Musgrave, an IMF big wig informs that an agent he trained is being held by an arms dealer. Ethan decides to rescue her and does but because of a dead man's switch that was implanted in her, she is killed by remote. When Ethan returns, high ranking IMF man, Brassel chastises both Ethan and Musgrave for their actions. Ethan decides to go off book and bring the arms dealer in. But before leaving he marries Julia. After apprehending the arms dealer Ethan returns with him to the States but upon arriving they are attacked and the arms dealer escapes. Later Julia is abducted.

Mission: Impossible - Ghost Protocol 2006

In the fourth installment of the Mission Impossible series, Ethan Hunt and a new team race against time to track down Hendricks, a dangerous terrorist who has gained access to Russian nuclear launch codes and is planning a strike on the United States. An attempt by the team to stop him at the Kremlin ends in a disaster, with an explosion causing severe damage to the Kremlin and the IMF being implicated in the bombing, forcing the President to invoke Ghost Protocol, under which the IMF is disavowed, and will be offered no help or backup in any form. Undaunted, Ethan and his team chase Hendricks to Dubai, and from there to Mumbai, but several spectacular action sequences later, they might still be too late to stop a disaster.

